window.bookSummaryJSON = "<p><b>\"Prophecy always finds a way.\"</b></p> <p>The will of the fates has come to pass. Monsters swarm from the depths, while dragons soar overhead. And the throne of Islor lies vacant . . . but not for long.</p> <p>Fleeing the merciless sirens, Tyree and Annika find themselves stranded on a distant shore. Forced together to survive, they find old magics and terrifying new enemies.</p> <p>For Romeria and Zander, the long-held secrets of the casters' magic reveal a chance to finally master the power that has held all their lives in the balance for too long. But with power comes betrayal. And sacrifices must be made.</p> <p><i>The final book in the captivating Fate of Wrath and Flame series.</i></p>"; 
